import{_ as i,o as a,c as l,S as o}from"./chunks/framework.6dec00fa.js";const d="/Infini/midjourney/1.png",e="/Infini/midjourney/2.png",b=JSON.parse('{"title":"Midjourney 使用教程","description":"","frontmatter":{},"headers":[],"relativePath":"tools/image/midjourney.md","filePath":"tools/image/midjourney.md","lastUpdated":1746559578000}'),r={name:"tools/image/midjourney.md"};function n(s,t,u,h,c,m){return a(),l("div",null,t[0]||(t[0]=[o('<h1 id="midjourney-使用教程" tabindex="-1">Midjourney 使用教程 <a class="header-anchor" href="#midjourney-使用教程" aria-label="Permalink to &quot;Midjourney 使用教程&quot;">​</a></h1><h2 id="什么是-midjourney" tabindex="-1">什么是 Midjourney？ <a class="header-anchor" href="#什么是-midjourney" aria-label="Permalink to &quot;什么是 Midjourney？&quot;">​</a></h2><p>Midjourney 是一款在 Discord 平台上运行的 AI 绘画工具，它能将文字描述转化为高质量的图像作品。无需绘画基础，只要能用语言表达你的创意想法，AI 就能帮你实现。</p><h3 id="社区特色" tabindex="-1">社区特色 <a class="header-anchor" href="#社区特色" aria-label="Permalink to &quot;社区特色&quot;">​</a></h3><p>Midjourney 选择在 Discord 上运行，这使它不仅仅是一个工具，更是一个充满活力的创作社区。在 Discord 服务器中，你可以：</p><ul><li>欣赏其他创作者的作品</li><li>交流创作心得</li><li>互相学习和启发</li><li>参与社区讨论</li></ul><h3 id="独特优势" tabindex="-1">独特优势 <a class="header-anchor" href="#独特优势" aria-label="Permalink to &quot;独特优势&quot;">​</a></h3><p>相比 DALL-E 和 Stable Diffusion 等其他 AI 绘画工具，Midjourney 的最大特点在于：</p><ul><li>出色的美学把控</li><li>更符合艺术审美的输出</li><li>独特的艺术风格</li><li>优秀的细节处理</li></ul><p><img src="'+d+'" alt="Midjourney 示例作品"></p><h2 id="订阅方案" tabindex="-1">订阅方案 <a class="header-anchor" href="#订阅方案" aria-label="Permalink to &quot;订阅方案&quot;">​</a></h2><p>Midjourney 提供了多个订阅套餐，满足不同用户的需求：</p><p><img src="'+e+'" alt="Midjourney 订阅方案"></p><h3 id="详细价格表" tabindex="-1">详细价格表 <a class="header-anchor" href="#详细价格表" aria-label="Permalink to &quot;详细价格表&quot;">​</a></h3><table><thead><tr><th>订阅套餐</th><th>价格</th><th>速度</th><th>图片数量</th><th>适用人群</th><th>特殊功能</th></tr></thead><tbody><tr><td>Basic</td><td>$10/月</td><td>标准</td><td>约200张图</td><td>初学者</td><td>基础功能，共享GPU</td></tr><tr><td>Standard</td><td>$30/月</td><td>较快</td><td>约900张图</td><td>活跃爱好者</td><td>基础功能，共享GPU</td></tr><tr><td>Pro</td><td>$60/月</td><td>快速</td><td>约2000张图</td><td>专业创作者</td><td>Fast GPU模式，Stealth模式</td></tr><tr><td>Mega</td><td>$120/月</td><td>最快</td><td>约4000张图</td><td>商业/团队</td><td>Fast GPU模式，Stealth模式，最高优先级</td></tr></tbody></table><h2 id="开通步骤" tabindex="-1">开通步骤 <a class="header-anchor" href="#开通步骤" aria-label="Permalink to &quot;开通步骤&quot;">​</a></h2><h3 id="_1-注册-discord-账号" tabindex="-1">1. 注册 Discord 账号 <a class="header-anchor" href="#_1-注册-discord-账号" aria-label="Permalink to &quot;1. 注册 Discord 账号&quot;">​</a></h3><p>使用 Midjourney 的第一步是创建 Discord 账号：</p><ol><li>访问 <a href="https://discord.com" target="_blank" rel="noreferrer">Discord 官网</a></li><li>点击注册按钮</li><li>填写必要信息</li><li>验证邮箱</li></ol><h3 id="_2-访问-midjourney-官网" tabindex="-1">2. 访问 Midjourney 官网 <a class="header-anchor" href="#_2-访问-midjourney-官网" aria-label="Permalink to &quot;2. 访问 Midjourney 官网&quot;">​</a></h3><ol><li>打开浏览器访问 <a href="https://www.midjourney.com" target="_blank" rel="noreferrer">Midjourney 官网</a></li><li>点击右下角的 &quot;Sign Up&quot; 按钮（如果已有账号，选择 &quot;Log In&quot;）</li><li>按提示完成 Discord 账号绑定</li><li>完成账号关联</li></ol><h3 id="_3-订阅服务" tabindex="-1">3. 订阅服务 <a class="header-anchor" href="#_3-订阅服务" aria-label="Permalink to &quot;3. 订阅服务&quot;">​</a></h3><ol><li>在网站顶部导航栏找到 &quot;Plans&quot; 或 &quot;Subscription&quot;</li><li>查看并选择合适的订阅计划</li><li>点击 &quot;Subscribe&quot; 或 &quot;选择此计划&quot;</li><li>使用 Infini 卡完成支付： <ul><li>填写卡号</li><li>输入有效期</li><li>输入安全码(CVV)</li></ul></li></ol><div class="tip custom-block"><p class="custom-block-title">订阅建议</p><ul><li>新手建议从 Basic 计划开始</li><li>需要更多创作自由度可以选择 Pro 计划</li><li>商业用途推荐 Mega 计划</li></ul></div><div class="warning custom-block"><p class="custom-block-title">注意事项</p><ol><li>确保 Infini 卡余额充足</li><li>仔细核对账单信息</li><li>建议开启订阅提醒</li></ol></div>',25)]))}const q=i(r,[["render",n]]);export{b as __pageData,q as default};
